import { Box, Container } from "@material-ui/core"

const App = () => {
  return (
    <Box >
      <Container maxWidth={'xs'}>
        <Box style={{ height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        Content
        </Box> 
      </Container> 
    </Box>
  );
};

export default App;
